import { Button, Row, Col, Carousel, Container } from "react-bootstrap";

const Booking = () => {
  const imageGroups = [
    [
      "https://i0.wp.com/picjumbo.com/wp-content/uploads/beautiful-nature-mountain-scenery-with-flowers-free-photo.jpg?w=600&quality=80",
      "https://t4.ftcdn.net/jpg/06/78/51/55/360_F_678515518_mBTG4aFYf8VCVWTL75PVaiMQhigbhhlY.jpg",
      "https://t4.ftcdn.net/jpg/07/08/47/75/360_F_708477508_DNkzRIsNFgibgCJ6KoTgJjjRZNJD4mb4.jpg",
    ],
    [
      "https://images.unsplash.com/photo-1506744038136-46273834b3fb",
      "https://images.unsplash.com/photo-1581093588401-9ff9c3d2b27b",
      "https://images.unsplash.com/photo-1508923567004-3a6b8004f3d1",
    ],
  ];

  return (
    <div>
      <section className="py-5 bg-white text-center">
        <Container fluid>
        <div className="my-4">
          <Button variant="danger" className="px-5 fs-6 py-3 m-2 rounded-0">
            Book A Tour
          </Button>
        </div>

        <Row className="align-items-center">
          <Col md={4} xs={12} className="text-start px-5">
            <p className="">
              A half-century is a long time, but the Churchgate group has continuously
              delivered on its promise to enhance the productivity and economic growth of
              Nigeriaâ€™s most successful entities by providing choice properties across the
              country.
            </p>
            <Button variant="danger" className=" rounded-0 mt-5">
              More About Us
            </Button>
          </Col>

          <Col md={8}>
            <Carousel controls indicators>
              {imageGroups.map((group, idx) => (
                <Carousel.Item key={idx}>
                  <Row className="">
                    {group.map((src, i) => (
                      <Col xs={4} key={i} className="p-5">
                        <img
                          src={src}
                          alt={`Building ${i + 1}`}
                          className="img-fluid mb-3 px-2 "
                          style={{ height: "450px", objectFit: "cover" }}
                        />
                      </Col>
                    ))}
                  </Row>
                </Carousel.Item>
              ))}
            </Carousel>
          </Col>
        </Row>
        </Container>
      </section>
    </div>
  );
};

export default Booking;
